INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (91002, 8, 2, 1, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 7, 10118, "フリーマーケット会場", 20063115, "青空の下で謁見", 40, 0, "ペコリーヌとの出会い", 5118061, 2834);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (91002, 8, 2, 1, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 7, 10118, "フリーマーケット会場", 20063115, "未来の騎空団\nマスコット？", 40, 0, "マホとの出会い", 5118062, 2835);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (91002, 8, 2, 1, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 7, 10118, "ランドソル市街地", 20063115, "お嬢さまからの\n緊急依頼", 40, 0, "アキノとの出会い", 5118063, 2837);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (91002, 8, 2, 1, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 18, 10118, "フリーマーケット会場", 20063115, "黄金色の悩みごと", 40, 0, "ジュンとの出会い", 5118064, 4108402);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (91002, 8, 2, 1, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 18, 10118, "フリーマーケット会場", 20063115, "白熱！　格闘大会！", 40, 0, "カオリとの出会い", 5118065, 4107402);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (91002, 8, 2, 1, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 16, 10118, "オーエド町", 20063115, "祭り太鼓はオーエドの華", 40, 1, "ニノンとの出会い", 5118066, 9000227);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (91002, 8, 3, 1, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 19, 10118, "フリーマーケット会場", 20063115, "人気者は遅れて\nやってくる", 40, 0, "スズナとの出会い", 5118067, 2101181);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (91002, 8, 3, 1, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 18, 10118, "ランドソル市街地", 20063115, "巫女・ミーツ・魔法少女", 40, 0, "ナナカとの出会い", 5118068, 4109402);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (91002, 8, 3, 1, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 18, 10118, "フリーマーケット会場", 20063115, "ネズ耳は二度なくなる", 40, 0, "キャル＆コッコロとの出会い", 5118069, 4305402);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (91002, 8, 3, 1, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 18, 10118, "ランドソル市街地", 20063115, "この出会いにカンパイ！", 40, 0, "ユカリとの出会い", 5118070, 4101402);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (91002, 8, 3, 1, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 18, 10118, "ランドソル市街地", 20063115, "陰陽アンサンブル", 40, 0, "アオイとの出会い", 5118071, 4106402);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (91002, 8, 3, 1, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 7, 10118, "フリーマーケット会場", 20063115, "運試し十番勝負！", 40, 1, "シノブとの出会い", 5118072, 2836);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (0, 0, 1, 0, 0, 0, 10118, 0, 20063115, "彼女たちの新たな日常", 0, 0, "オープニング", 5118600, 0);
